import React, { Component } from 'react';
import logo from '../log.jpg';
import { Link } from "react-router-dom";
import { Navbar, Nav, NavItem, NavLink } from 'reactstrap';
import './Header.css';

class Header extends Component {
  render() {
    return (
      <Navbar default collapseOnSelect>
        <Navbar.Header>
          <Navbar.Brand>
            <Link to="/">FoodShare</Link>
          </Navbar.Brand>
          <Navbar.Toggle />
        </Navbar.Header>
        <Navbar.Collapse>
          <Nav pullRight>
            <NavItem eventKey={1}>
              <NavLink className="font-weight-bold" tag={Link} to="/">Home</NavLink>
            </NavItem>
            <NavItem eventKey={2}>
              <NavLink className="font-weight-bold" tag={Link} to="/posts/">Explore</NavLink>
            </NavItem>
            <NavItem eventKey={3}>
              <NavLink className="font-weight-bold" tag={Link} to="/donation/">Donate</NavLink>
            </NavItem>
            <NavItem eventKey={4}>
              <NavLink className="font-weight-bold" tag={Link} to="/">About</NavLink>
            </NavItem>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    )
  }
}
export default Header;
